  return (
    <HashRouter basename='/'>
      <div className="App">

        <NavMenu OnChange={this.SetSiteState} CartNum={this.state.shoppingCart.length}/>
        {siteMap[this.state.siteState]}
      </div>
    </HashRouter>
  );
}

export default App;
